import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className='App'>
      <h1>
        E-Wardrobe
      </h1>
        <button onClick={addItem}>Add a clothe</button>
    </div>
  );
}

function addItem(){
    alert("Do you really want to add a clothe in your  E-Wardrobe ?")
}
export default App;
